            <div id="NavMiddle">
            <a id="BlogBtn" onClick={scrollToBlog}>Blog</a>
            <a id="Home" href="index.html">Home</a>
            <a id="Projects" href="">Projects</a>
            </div>
            <a href="socials.html" id="Socials">Socials</a>
        </div>
    );
}
